import React from "react";
import Won from './Won';
import Lost from "./Lost";

const Slots = (props) => {
    // let x = props.x;
    // let y = props.y;
    // let z = props.z;
    let {x,y,z} = {props}

    if( (x===y) && (y===z) && (z===x)){
        return <Won/>
    }
    else if ((x!==y) || (y!==z) || (z!==x)){
        return <Lost/>
    }
}

 export default Slots;
